import React from 'react';
import classes from './Input.module.css';

const Input = (props) => {
  return (
    <div className={`${classes} ${props.classes}`}>
      <label className={props.classes}>{props.label}</label>
      <input className={props.classes} />
    </div>
  );
};

export default Input;
